import styles from "./styles.module.scss";

import { MdAddShoppingCart } from "react-icons/md";
import { Link } from "react-router-dom";
import { SyntheticEvent } from "react";

interface CardProps {
  image: string;
  title: string;
  price: string;
}

export function Card(props: CardProps) {
  function showMessageTest(e: SyntheticEvent) {
    e.preventDefault();
    console.log("testando");
  }

  return (
    <div className={styles.card}>
      <Link to="/productDetails">
        <div className={styles.productImage}>
          <img src={props.image} alt="product" />
        </div>
        <div className={styles.productInfo}>
          <div className={styles.productName}>{props.title}</div>
          <div className={styles.productPrice}>{props.price}</div>
          <button onClick={showMessageTest} className={styles.addToCar}>
            <MdAddShoppingCart onClick={showMessageTest} />
          </button>
        </div>
      </Link>
    </div>
  );
}
